import { stringify } from "querystring"
import axios from "services/_base/_axios"
import {  IFetchAllAction } from "./types"

class VesselServices {
  public async fetchAll(params: IFetchAllAction) {
    return axios.get(`/vessels?${stringify(params)}`)
  }
}

export default new VesselServices()
